import React from "react";
import mchammer from "../../img/test/mchammer.gif";
import selfIcon from "../../img/self_image.png";

const Icon = () => {
  return <img src={selfIcon} alt="icon of myself"></img>;
};

const McHammer = () => {
  return <img src={mchammer} alt="gif of mchammer"></img>;
};

const McHammers = () => {
  const hammers = [];
  for (let step = 0; step < 5; step++) {
    hammers.push(McHammer);
  }
  console.log(hammers);
  return hammers;
};

const Main = () => {
  return (
    <div>
      <div className="welcome">
        <h1 style={{ marginTop: "50px" }} className="welcome-msg">
          Welcome to the 20000 legues under the sea!!!
        </h1>
        <McHammers />
      </div>
    </div>
  );
};

export default Main;
